message:
​​Главное к 17:15:

— Встреча делегаций России и Украины должна состояться 2 марта;

— Зеленский выступил в Европарламенте по видеосвязи;

— Эстония и Польша запретили пролёт российской делегации во главе с Лавровым в Женеву;

— Авиакомпания S7 отменяет до 8 марта все рейсы в Анапу, Белгород, Брянск, Воронеж, Геленджик, Краснодар, Липецк, Ростов-на-Дону, Симферополь и обратно;

— «Автоваз» резко повысил цены на все автомобили Lada, пишет Forbes. В среднем они выросли на 15%;

— Instagram заблокировал аккаунты RT в 27 странах Европы;

— ФАС: «Ашан», «Атак», «О’Кей» и «Магнит» ограничат свои наценки на молочные продукты, хлеб, сахар и овощи борщевого набора на уровне 5%

— Отменили свои концерты в России: Игги Поп, The Neighborhood, Imagine Dragons, Томми Джинезис, Apashe, Green Day, The Killers, Franz Ferdinand и Brainstorm

Выступление Зеленского в Европарламенте (по видеосвязи): 

— Все крупные города Украины заблокированы; 

— У меня нет заранее написанной речи, потому что сейчас мне не до этого. Наша реальность сегодня — это погибающие каждый день люди; 

— Я не знаю, как сейчас приветствовать людей. Я не могу сказать „добрый день” или „добрый вечер. Каждый день для нас — плохой; 

— У меня две минуты, чтобы с вами поговорить. У нас постоянные обстрелы; 

— Каждая площадь с сегодняшнего дня, как бы она ни называлась и где бы ни была, будет называться площадью свободы; 

— С Украиной ЕС будет крепче. Без ЕС Украина будет одинокой; 

— Докажите, что вы вместе с нами и что вы настоящие европейцы

​​Главное к 15:00:

— Российские банки, попавшие под санкции, уже не смогут выпускать новые карты Visa и Mastercard, однако уже выданные карты продолжат работать внутри России — Национальная система платежных карт;

— Минимум 10 погибших, 20 раненых — официальное заявление Харьковской облгосадминистрации (рядом с со зданием которой утром взорвалась ракета);

— Роскомнадзор снова начал замедлять Twitter на стационарных компьютерах «из-за фейков о ситуации в Украине», заявили в РКН;

— YouTube заблокировал в Украине «Первый канал», «Звезду», ТНТ и другие российские телеканалы — министр культуры Украины;

— Минобороны РФ проведёт в августе Первый Международный антифашистский конгресс;

— Правительство РФ купит акции российских компаний на 1 трлн рублей. Деньги на это они выделят из «Фонда национального благосостояния России».

Борис Джонсон:

– Европа должна отказаться от российских нефти и газа, несмотря на болезненность таких мер;

– Британия рассматривает возможность поднять вопрос об исключении России из Совета Безопасности ООН.

​​Главное к 12:00:

— Youtube заблокировал RT и Sputnik в Европе;

— Доллар — 94, евро — 105 (Мосбиржа);

— Кадыров: Среди уроженцев Чеченской Республики уже есть, к сожалению, потери. Двое умерло, ещё шестеро получили ранения разной степени;

— Лукашенко: Беларусь и далее не планирует участвовать в специальной операции на Украине;

— ЕС будет передавать Украине данные космической разведки о российских войсках — глава Евродипломатии Боррель;

— Свыше 377 тысяч беженцев из Украины въехали на территорию Польши — погранслужба Польши;

— Роспотребнадзор из-за снижения заболеваемости короной утвердил новые эпидрекомендации — только масочный режим и усиленная дезинфекция.

​​Главное за ночь:

– Евросоюз официально зарегистрировал заявку Украины на членство в ЕС и приступил к её рассмотрению;

– Сбер повысил ставки по потребительским кредитам до 21,9-29,9% (было 12,9-21,7%), а ВТБ — до 15,9-29,9% (было 5,9-13,8%);

– Warner Bros. отменила премьеру нового «Бэтмена» в России (он должен был выйти 2 марта);

– Walt Disney Company приостанавливает поставку своих фильмов в российские кинотеатры;

– Netflix отказался транслировать 20 российских федеральных телеканалов;

– Роскомнадзор заблокировал сайт сибирского СМИ «Тайга.инфо» из-за онлайн-трансляции событий в Украине;

– Mastercard заблокировал доступ к своей платёжной сети некоторым финансовым учреждениям РФ

​​Главное за день:

— Прошёл первый раунд переговоров России и Украины в Гомеле, следующая встреча состоится в ближайшие дни;

— Курсы доллара и евро на Мосбирже поднимались до 109 и 120 рублей; сейчас — 94 и 106 рублей;

— ЕС составил новый санкционный список;

— Банк России повысил ключевую ставку до 20%;

— Anonymous взломали сайты российских СМИ;

— Россия ограничила полеты авиакомпаний 36 стран;

— Зеленский подписал заявку Украины на вступление в Евросоюз;

— FIFA и UEFA отстранили российские сборные и клубы от участия во всех турнирах;

— Все мобильные операторы Украины запретили звонки с российских сим-карт на территории страны

​​Главное к 1:40:

— Совет Международной федерации хоккея (IIHF) отстранил сборные России и Беларуси от участия в международных матчах на неопределенный срок;

— Microsoft забанит RT и Sputnik в своих сервисах. Также компания поддержит своих сотрудников в Украине и в России;

— Meta ограничит доступ к RT и Sputnik на территории ЕС — вице-президент компании;

— Джастин Трюдо: Канада намерена запретить импорт нефти из РФ. Также Канада поставит Украине противотанковое оружие;

— Сбербанк после решения ЦБ экстренно повысить ключевую ставку увеличил стоимость ипотеки на новостройки и вторичное жильё до 18,6%;

— Зеленский подписал указ о введении временного безвизового режима для иностранцев, желающих вступить в «Интернациональный легион обороны Украины»;

— Шведские Volvo, Scania и Ericsson заявили о приостановке бизнеса в России;

— General Motors приостанавливает экспорт автомобилей в Россию;

— Все мобильные операторы Украины запретили звонки с российских сим-карт на территории страны

Джастин Трюдо:
- Канада намерена запретить импорт нефти из РФ;
- Канада поставит Украине противотанковое оружие

​​Главное к 23:00:

— Песков: Путин, возможно, уже сегодня получит полный доклад по итогам переговоров с Киевом и даст поручения о дальнейших действиях;

— FIFA и UEFA отстранили российские сборные и клубы от участия во всех турнирах;

— Банк России решил не возобновлять завтра торги акциями на Мосбирже. Торги валютой будут;

— В Киеве полностью запрещается продажа алкоголя с завтрашнего дня — мэр Киева Кличко;

— Shell намерена прекратить участие в строительстве газопровода «Северный поток — 2» и проекте «Сахалин-2»

— Британская олимпийская ассоциация и Олимпийский комитет Германии требуют немедленного исключения России и Беларуси из международной спортивной семьи

— Володин одобрил предложение разработать законопроект об уголовной ответственности за фейки о действиях российских войск. Законопроект о наказании за фейки предполагает до 15 лет лишения свободы

— ЕС опубликовал новый санкционный список. В списке: Песков, Ролдугин, Усманов, Красовский, Прилепин, Мамонтов, Кеосаян, Скабеева и другие

Заявления Минобороны РФ: 

— Россия не начинала военные действия. Россия их завершает

— В военной операции на Украине участвуют только офицеры и контрактники;

— Силы ДНР завершают блокирование Мариуполя;

— Все населенные пункты, перешедшие под контроль российских вооруженных сил, продолжают жить в обычном режиме, функционируют объекты жизнеобеспечения, работает транспорт;

— Военные действия со стороны режима в Киеве и планомерное уничтожение жителей Донбасса шло 8 лет. В ходе этой войны, погибло более 14 тысяч человек, сотни детей;

— Надо было положить конец бесконечным угрозам со стороны киевского режима в адрес России. И Россия это сделает

​​Главное к 15:00:

— Начались переговоры России и Украины в Гомеле;

— ЦБ решил не запускать сегодня торги акциями на Мосбирже;

— Бумаги «Сбера» на лондонской бирже упали на 75,11% — до $1,011;

— С 24 февраля в Украине были убиты минимум 102 гражданских лица, ранены 304 человека — комиссар ООН по правам человека;

—   YouTube заблокировал «Россия24» и НТВ на территории Украины;

— Anonymous взломали сайты СМИ

Сейчас доллар — 95, евро — 106

​​Главное на 11:15:

— Переговоры Украины начнутся примерно в 12:00;

— Банк России повышает ключевую ставку до 20%;

— Курсы доллара и евро на Мосбирже — 100,96 руб и 113,52 руб;

— Авиакомпания «Победа» отменила все рейсы в Европу, деньги вернутся на карты автоматически;

— Мобилизационная кампания в ДНР приостанавливается;

— Торги акциями на Мосбирже откроются не ранее 15:00 Мск, а дополнительные решения будут объявлены в 13:00;

— Минобороны РФ: «российские силы взяли под контроль Бердянск и Энергодар, а также полностью контролируют территорию вокруг Запорожской АЭС». Украинский «Энергоатом» опровергает последнее утверждение.

Рубль на рынке Forex восстанавливается:
– доллар — 108 руб;
– евро - 122 руб

Исторический максимум, зафиксированный этим утром:
– доллар — 117,82 руб;
– евро — 132,88 руб

​​Главное за ночь:

– Евро торгуется около 127 рублей на рынке Forex, доллар — около 113 (это исторические максимумы). Торги на валютном и денежном рынках Мосбиржи откроются в 10:00 Мск;

– За поправки в конституцию Беларуси на референдуме проголосовали 65,16% граждан, решение принято — глава ЦИК Беларуси;

– Кипр закрыл воздушное пространство для России;

– Bloomberg: ЕС может ввести санкции против богатейших людей России;

– МВД Украины: за всё время среди мирного населения погибли 352 человека, в том числе 14 детей;

– Переговоры РФ и Украины начнутся в утренние часы — ТАСС со ссылкой на источник

Председатель Европейского парламента Боррель:

— Главы МИД ЕС согласовали предоставление летального оружия Украине на сумму 450 миллионов евро;

— ЕС не может полностью отключить Россию от SWIFT, потому что экономика РФ связана с экономиками других стран;

— Санкции ЕС заморозят около половины финансовых резервов России

​​Главное к 20:00

— ЕС полностью закрывает воздушное пространство для России — глава Еврокомиссии;

— ЕС запретит все транзакции с Центробанком России. Кроме того, Евросоюз введет пакет экономических и персональных санкций против Беларуси;

— ЕС запретит Russia Today и Sputnik в странах союза — глава Еврокомиссии;

— В аэропорту Гостомель под Киевом был сожжен Ан-225 «Мрия» — самый большой и грузоподъёмный самолёт в мире;

— По словам Верховного комиссара ООН, в ЕС въехало 368 000 украинцев;

— Павел Дуров сообщил, что Telegram не будет ограничивать работу телеграм-каналов;

— Зеленский: Лукашенко заверил меня, что войска из Беларуси не будут идти в Украину, а также не будут лететь ракеты/самолёты/вертолёты

— Минобороны РФ: Среди российских военных в ходе специальной военной операции есть погибшие и раненые (они объявили об этом впервые за всё время операции)

— Минобороны РФ: Мы знаем, как относятся украинские нацисты к немногим захваченным российским военнослужащим. И видим, что истязания и пытки те же, что были у германских нацистов и их прихвостней-полицаев в Великую Отечественную. Фиксируются и идентифицируются все лица, голоса, телефоны их координаты, IP-адреса, а также переписка всех украинских нацистов, причастных к издевательствам над нашими товарищами

⚡️Новые санкции от Евросоюза:

— ЕС полностью закрывает воздушное пространство для России, в том числе для частных самолётов;

— ЕС запретит Russia Today и Sputnik в странах союза;

— ЕС запретит все транзакции с Центробанком России. Кроме того, Евросоюз введет пакет экономических и персональных санкций против Беларуси

Главное к 17:00

— Путин приказал Минобороны перевести российские силы сдерживания (ядерные и гиперзвуковые ракеты) в особый режим боевого дежурства;

— Песков: Делегация Украины едет на переговоры с российской стороной в белорусский Гомель. Конкретное место встречи делегаций РФ и Украины раскрываться не будет — ТАСС со ссылкой на источник;

— Украина направила иск против России в Международный суд ООН в Гааге; 

— Украинские власти планируют освободить заключённых-бывших военных, которые изъявят желание участвовать в боевых действиях на стороне Украине;

— Украина полностью контролирует Харьков;

— Токио поддержит отключение российских банков от SWIFT и примет санкции против Путина;

— Швеция, Германия, Бельгия, Франция и Норвегия также запретили самолётам РФ летать в своём воздушном пространстве;

— Сборная Чехии по футболу отказалась от проведения возможного стыкового матча со сборной России за право участия в ЧМ в Катаре

Главное к 13:00:

– В Харькове и Буче (Киевская область) уличные бои;

– Российская делегация заявила, что приехала в Беларусь на переговоры с Украиной. Зеленский заявил, что готов приехать в любую другую страну, «с территории которой не летят ракеты»;

– РБК сообщил о готовящемся выступлении Путина, но Песков вскоре это опроверг;

– Зеленский направил письма в VISA и MasterCard с просьбой прекратить работу сервисов на территории России;

– Ирландия, Австрия, Дания и Исландия закрыли своё воздушное пространство для российских самолётов;

Кстати, в Беларуси сегодня проходит референдум по поправкам в конституцию — ЦИК уже признал его состоявшимся

Заявления Лукашенко: 

– [о выступлении Зеленского] «"Наполеончик" обратился к Беларуси и советовал, что делать! К кому он обращается? Мы же всегда по-человечески относились к украинцам!»;

– «День-два — будет война, а через три дня — мясорубка»;

– Конфликт на Украине — это еще цветочки, надо прекратить его;

– Фиксировались случаи завоза оружия из Украины в Беларусь, украинцы готовили бандформирования для провокаций в республике;

– «На Украине нет ни белорусских солдат, ни вооружения, ни боеприпасов, России и не нужна такая помощь»

– На Украине отлавливают и избивают русских и белорусов;

– До сих пор Киев никто не бомбил.

Главное за ночь:

– В Харькове произошла серия мощных взрывов — местные СМИ называют её «самой сильной за все три дня». Среди прочего сообщается о взрыве на газопроводе;

– Под Васильковом (Киевская область) тоже взрывы, загорелась нефтебаза, сообщает мэр города. Местные СМИ уже говорят, что это «экологическая катастрофа, которую некому тушить»;

– ЕС, США и другие западные страны объявили об отключении санкционных банков РФ от SWIFT, а также о заморозке активов российских бизнесменов и Центробанка;

Главное к 3:00:

– В Харькове всю ночь идёт серия мощных взрывов — местные СМИ называют её «самой сильной за все три дня». Среди прочего сообщается о взрыве на газопроводе;

– Под Васильковом (Киевская область) взрывы, горит нефтебаза, сообщает мэр города. Местные СМИ уже говорят, что это «экологическая катастрофа, которую некому тушить»;

– ЕС, США и другие западные страны объявили об отключении санкционных банков РФ от SWIFT, а также о заморозке активов российских бизнесменов и Центробанка;

– AMD и Intel приостановили поставки своей продукции на территорию России.

МИД Британии:

– Мы работаем по «черному списку» и будем вводить санкции против новых российских олигархов каждые несколько недель;

– В настоящее время вырабатывается план, который позволит конфисковать собственность уже попавших под санкции лиц

​​Главное к 20:00:

— Комиссар ООН: Украину покинули более 150 000 человек, направляются в основном в Польшу, Венгрию, Молдавию и Румынию;

— СМИ: Twitter заблокировал возможность регистрировать аккаунты в РФ;

— Президент Польши выступил за ускоренное принятие Украины в Евросоюз;

